package org.example.test;

import org.apache.commons.dbutils.DbUtils;
import org.junit.jupiter.api.Test;

import java.io.ByteArrayOutputStream;
import java.io.PrintStream;
import java.sql.SQLException;

import static org.junit.jupiter.api.Assertions.assertTrue;

public class DbUtilsTest {

    @Test
public void testPrintStackTrace() {
    // Step 2: Instantiate a new SQLException using its no-argument constructor
    SQLException sqlException = new SQLException("Test exception");

    // Step 4: Capture System.err to verify output
    ByteArrayOutputStream errContent = new ByteArrayOutputStream();
    PrintStream originalErr = System.err;
    System.setErr(new PrintStream(errContent));

    try {
        // Step 3: Invoke DbUtils.printStackTrace() with the SQLException instance
        DbUtils.printStackTrace(sqlException);

        // Flush to ensure all output is captured
        System.err.flush();

        // Verify that the stack trace is printed to the standard error stream
        String capturedOutput = errContent.toString();
        // Check for the class name which should be present in the output
        assertTrue(capturedOutput.contains("java.sql.SQLException"), 
            "Expected stack trace to contain 'java.sql.SQLException', but was: " + capturedOutput);
    } finally {
        // Restore original System.err
        System.setErr(originalErr);
    }
}
}

