public class DbUtilsPrintStackTraceTest {

    @Test
    public void testPrintStackTraceWithSQLExceptionAndPrintWriter() {
        // Step 0: Initialize a new SQLException instance
        SQLException sqlException = new SQLException("Test SQL Exception");

        // Step 1: Create a PrintWriter instance targeting the standard error stream
        StringWriter stringWriter = new StringWriter();
        PrintWriter errorWriter = new PrintWriter(stringWriter);

        // Step 5: Create a nested exception to verify chain processing
        SQLException nestedException = new SQLException("Nested SQL Exception");
        sqlException.setNextException(nestedException);

        // Step 3: Pass the SQLException instance to the printStackTrace method on DbUtils
        DbUtils.printStackTrace(sqlException, errorWriter);

        // Step 4: Verify the operation completes without throwing exceptions
        // (Implicit in successful execution)

        // Flush the writer to ensure all output is written
        errorWriter.flush();

        // Verify that output was written
        String output = stringWriter.toString();
        assert output.contains("Test SQL Exception");
        assert output.contains("Nested SQL Exception");
    }
}
